window.bookSummaryJSON = "<p>One warrior queen, three dragons, and a formidable fae demigod. A reverse harem that heats your blood with four mates!</p> <p>My princes and I return to the Dragon Realm, only to find the mad Dragon King has burned half of the kingdom, and the dark fae's army is at our door.</p> <p>To defeat our ancient foes and put the broken realm back together, I must go on a quest to uncover the origin of my curse and unleash the great, terrible magic in me. But I can't leave my people to face the evil alone. In the midst of crisis, my dragon general returned. Adrian was my first crush before I vanished centuries ago. He's been searching for me ever since.</p> <p>With enemies all around to ensure the extinction of the dragon race, all I can trust is my devoted princes, an old flame, and Elvey, my heart. But first, my alpha males must put their rivalry and differences aside and learn to work together, or our Dragon Realm will be forever shattered and our race no more.</p> <p><b>Warning: This is a reverse harem fantasy/paranormal romance that features one strong woman and her three hot Dragon princes. It contains battles, steamy scenes, raw language, magic, swordfights, dark fae, dragon shifters, vampires, and otherworldly nightmares of creatures. And at last, true loves, with a happy ever after at the end of series.</b></p>"; 
